column8:
　インナーマッスルを鍛えよう！故障しない肩、肘関節を作っていこう！<br>
野球選手にとって最も大事な肩、肘関節。<br>
ケガを防止する為には、アウターマッスルとインナーマッスルをバランスよく鍛えることが必要です。<br>
正しい方法でトレーニングするよう心掛けましょう。<br>
